package haystack;

import org.junit.Assert;
import org.junit.Test;

public class SolutionTest {
	@Test
	public void test1() {
		Solution solution = new Solution();
		String haystack = "foo bar blah foo";
		String needle = "bla";
		String result = solution.strStr(haystack, needle);
		Assert.assertEquals("blah foo", result);
	}
	
	@Test
	public void test2() {
		Solution solution = new Solution();
		String haystack = "foo bar blah foo";
		String needle = "zzz";
		String result = solution.strStr(haystack, needle);
		Assert.assertNull(result);
	}
	
	@Test
	public void test3() {
		Solution solution = new Solution();
		String haystack = "a";
		String needle = "";
		String result = solution.strStr(haystack, needle);
		Assert.assertEquals("a", result);
	}
	
	@Test
	public void test4() {
		Solution solution = new Solution();
		String haystack = "mississippi";
		String needle = "issipi";
		String result = solution.strStr(haystack, needle);
		Assert.assertNull(result);
	}
	
	@Test
	public void test5() {
		Solution solution = new Solution();
		String haystack = "";
		String needle = "";
		String result = solution.strStr(haystack, needle);
		Assert.assertEquals("", result);
	}
	
	@Test
	public void test6() {
		Solution solution = new Solution();
		String haystack = "";
		String needle =   "";

		String result = solution.strStr(haystack, needle);
		Assert.assertEquals(null, result);
	}
	
	@Test
	public void test7() {
		Solution solution = new Solution();
		String haystack = "mississippi";
		String needle = "issip";
		String result = solution.strStr(haystack, needle);
		Assert.assertEquals("issippi", result);
	}
	
	@Test
	public void test8() {
		Solution solution = new Solution();
		String haystack = "mississippi";
		String needle = "issi";
		String result = solution.strStr(haystack, needle);
		Assert.assertEquals("ississippi", result);
	}
	
	@Test
	public void test9() {
		Solution solution = new Solution();
		String haystack = "baabbaaaaaaabbaaaaabbabbababaabbabbbbbabbabbbbbbabababaabbbbbaaabbbbabaababababbbaabbbbaaabbaababbbaabaabbabbaaaabababaaabbabbababbabbaaabbbbabbbbabbabbaabbbaa";
		String needle = "bbaaaababa";
		String result = solution.strStr(haystack, needle);
		Assert.assertEquals("bbaaaabababaaabbabbababbabbaaabbbbabbbbabbabbaabbbaa", result);
	}
	
}
